import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home">
      {/* Image Background */}
      <img src="/r1.jpg" alt="Health&me background" className="background-image" />

      {/* Text over Image */}
      <h1>Welcome to Health&Me</h1>
      <p>Your personal guide to food logging, exercise tracking, and more!</p>
    </div>
  );
}

export default Home;
